import React, { useState } from 'react';
import { Router, Link } from "@reach/router"
import Header from "./Components/Header"
import Display from "./Components/Display"
import Registration from "./Components/Registration"
import Login from "./Components/Login"
import New from "./Components/New"
import Update from "./Components/Update"
import One from "./Components/One"
import Form from "./Components/Form"
import './App.css';


function App() {
  return (
    <div>
      <div className="App">
        <div>
          <h1 style={{margin:"40px 0px 0px 0px"}}>Algorithm Visualizer</h1>
        </div>
        <Visualizer></Visualizer>
        <Router>
          <Registration path="/new"/>
          <Display path="/algos/"/>
          <New path="/algos/:id/newAlgo"/>
          <Update path="/algos/:id/:aid/update"/>
          <One path="/algos/:id/:aid"/>
      </Router>
      <nav className="text-center" style={{margin:"4% 50% 0% 0%", height:"75px", width:"100%"}}>
        <Link to="/">Registration</Link> |&nbsp;
        <Link to="/">Login</Link> |&nbsp;
        <Link to="/new">Not A New Algo</Link> |&nbsp;
        <Link to="/update">Not Updating Algo</Link> |&nbsp;
        <Link to="/one/">Random Algo</Link> |&nbsp;
        <Link to="/users/display/all">All our Algos are not here</Link> 
      </nav>
      </div>
    </div>
  );
}

export default App;
